import React from 'react'; 
import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <div className="container mx-auto mt-12 text-center p-6 bg-gray-100 rounded-lg shadow-lg">
      <h1 className="text-5xl font-bold mb-6 text-gray-800">Welcome to Project Manager</h1>
      <p className="mb-6 text-lg text-gray-600">Manage your projects and organizations efficiently.</p>
      <div className="flex justify-center space-x-4">
        <Link to="/register" className="bg-blue-600 hover:bg-blue-700 text-white px-6 py-3 rounded transition duration-200">Get Started</Link>
        <Link to="/login" className="bg-green-600 hover:bg-green-700 text-white px-6 py-3 rounded transition duration-200">Login</Link>
      </div>
    </div>
  );
};

export default Home;
